import React from "react";
import "./Components.css";
import { Component1 } from "./Hero/Component1";
import { Component2 } from "./Hero/Component2";
import { Component3 } from "./Hero/Component3";
import { myContext } from "../App";
import { useContext } from "react";

export const Hero = () => {
  const data = useContext(myContext);
  return (
    <>
      <div id="hero">
        {
          (data.menu = "menu2" ? (
            <Component2 />
          ) : (
            (data.menu = "menu3" ? <Component3 /> : <Component1 />)
          ))
        }
      </div>
    </>
  );
};
